  input: TEXT,"F3A","","This amendment addresses the FEC questions raised with respect
    to possible excess contributions listed originally in the April 2002 quartetly
    report; the October 2002 quarterly report and the 2001 mid-year report.  All general
    election contributions were refunded prior to November 9, 2002 as required by
    the FEC.  Due to a glitch in the data during as the Committee's computers wre
    moved from one office to another, some of the refund information was unintentionally
    lost.  It has been corrected in this amendment for these reports cited above.
    Addresses for Mark and Lauren Booth are correct.  They are U.S. citizens who live
    in the U.K.  There is no forwarding address for Justin Dart.  He is deceased.
    His general election refund has been returned repeatedly as undeliverable. His
    contribution will be disgorged to the U.S. Treausary's General Fund per the instrustions
    of the FEC."
